import React, { Component } from 'react';
import './App.css';
import Logo from './images/logo.png';
import Staff from './images/staff.png';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
	  <img id="logo" src={Logo} alt="EZNote" />
          <p id="intro">Hear what your music sounds like!</p>
        </header>
	<div id="body">
	  <div>
	    <div id="instr">
	      <p><b>Click</b> on the staff to add/remove notes.</p>
	      <p><b>Click and drag</b> to move a note around.</p>
	    </div>
	    <div id="playback">
	      <p>Speed (bpm):</p>
	      <button id="playbutton" type="button">Play</button>
	    </div>
	  </div>
	  <img id="staff" src={Staff} alt="Error: Staff could not be displayed." />
	</div>
      </div>
    );
  }
}

export default App;
